import pandas as pd
import datetime as dt

def _parse_ts(ts, convert_ts = None):
	if convert_ts is None:
		return ts
	if convert_ts == 'local':
		return dt.datetime.fromtimestamp(ts)
	if convert_ts == 'utc':
		return dt.datetime.utcfromtimestamp(ts)


def parse_kline(huodict, convert_ts = None):
	# huodict = {'status': 'ok', 'ch': 'market.btcusdt.kline.1min', 'ts': 1530635608657, 'data': [{'id': 1530635580, 'open': 6588.14, 'close': 6588.06, 'low': 6587.48, 'high': 6588.72, 'amount': 0.6187, 'vol': 4076.109122, 'count': 26}, {'id': 1530635520, 'open': 6588.06, 'close': 6588.16, 'low': 6587.48, 'high': 6588.19, 'amount': 0.7268, 'vol': 4788.188707, 'count': 44}, {'id': 1530635460, 'open': 6587.65, 'close': 6588.06, 'low': 6586.8, 'high': 6588.11, 'amount': 3.3509, 'vol': 22073.67809, 'count': 66}, {'id': 1530635400, 'open': 6583.76, 'close': 6588.1, 'low': 6583.76, 'high': 6588.1, 'amount': 1.0629, 'vol': 6998.926429, 'count': 40}, {'id': 1530635340, 'open': 6583.5, 'close': 6586.38, 'low': 6583.49, 'high': 6586.38, 'amount': 2.3345, 'vol': 15370.50849, 'count': 94}, {'id': 1530635280, 'open': 6584.23, 'close': 6583.5, 'low': 6582.32, 'high': 6584.78, 'amount': 4.3694, 'vol': 28768.47682, 'count': 91}, {'id': 1530635220, 'open': 6586.77, 'close': 6582.0, 'low': 6582.0, 'high': 6586.77, 'amount': 4.437651834694531, 'vol': 29223.005037, 'count': 87}, {'id': 1530635160, 'open': 6592.37, 'close': 6586.78, 'low': 6586.11, 'high': 6592.38, 'amount': 7.8341, 'vol': 51623.736958, 'count': 121}, {'id': 1530635100, 'open': 6592.43, 'close': 6592.37, 'low': 6591.99, 'high': 6593.25, 'amount': 2.629094419430478, 'vol': 17332.07197791, 'count': 89}, {'id': 1530635040, 'open': 6592.0, 'close': 6592.55, 'low': 6591.99, 'high': 6592.64, 'amount': 1.4431, 'vol': 9512.997191, 'count': 35}]}
	# convert_ts: {None, 'local', 'utc'}
	# return DataFrame ['open','high','low','close','volume','usd','trd_count'] with ascending timestamps
	try:
		raw_data = huodict['data']
		if len(raw_data) == 0:
			return pd.DataFrame(columns = ['open','high','low','close','volume','usd','trd_count'])
		res = []
		for bar in raw_data:
			res.append([bar['id'], bar['open'], bar['high'], bar['low'], bar['close'], bar['amount'], bar['vol'], bar['count']])
		res = pd.DataFrame(res, columns = ['ts','open','high','low','close','volume','usd','trd_count'])
		res.set_index('ts', inplace = True)
		res.sort_index(inplace = True)
		res.index = res.index.map(lambda x: _parse_ts(x, convert_ts))
		return res
	except KeyError:
		print('{0} - parse_kline: wrong format'.format(dt.datetime.now()))
		return None

