def parse_depth(huodict, level = 1, convert_ts = None):
	# huodict = {'status': 'ok', 'ch': 'market.btcusdt.depth.step1', 'ts': 1530637998621, 'tick': {'bids': [[6577.17, 0.0009], [6576.84, 0.0011], [6576.83, 0.0101], [6576.82, 0.01], [6576.51, 0.1333], [6576.5, 0.0907], [6576.35, 0.0351], [6576.34, 0.0648], [6576.2, 0.0697], [6576.19, 0.01], [6575.88, 0.0116], [6575.35, 0.6279], [6575.25, 0.01], [6575.04, 0.08], [6575.0, 1.084], [6574.41, 0.0265], [6574.0, 0.008], [6573.88, 0.1426], [6573.09, 0.506], [6572.75, 0.008]], 'asks': [[6577.44, 0.008], [6577.48, 0.0795], [6577.49, 0.0365], [6577.5, 0.0904], [6577.51, 0.0638], [6577.56, 0.0365], [6577.57, 0.1052], [6577.58, 0.01], [6577.6, 0.0795], [6577.72, 0.1245], [6577.73, 0.0365], [6577.75, 0.0265], [6578.16, 0.0265], [6579.13, 0.5973], [6579.37, 0.008], [6579.47, 0.6], [6579.65, 0.1], [6580.78, 0.094], [6580.9, 0.02], [6581.02, 0.6]], 'ts': 1530637998018, 'version': 11264053901}}
	try:
		raw_bids = huodict['tick']['bids']
		raw_asks = huodict['tick']['asks']
		ts = huodict['tick']['ts']

		bid_level = min(level, len(raw_bids))
		ask_level = min(level, len(raw_asks))

		if bid_level == 0:
			bidprice = []
			bidqty = []
		else:
			bidprice = [raw_bids[x][0] for x in range(bid_level)]
			bidqty = [raw_bids[x][1] for x in range(bid_level)]

		if ask_level == 0:
			askprice = []
			askqty = []
		else:
			askprice = [raw_asks[x][0] for x in range(ask_level)]
			askqty = [raw_asks[x][1] for x in range(ask_level)]

		res = pd.Series(bidprice + bidqty + askprice + askqty)
		res.index = ['bidprice_{0}'.format(x) for x in range(bid_level)] + ['bidqty_{0}'.format(x) for x in range(bid_level)] \
				  + ['askprice_{0}'.format(x) for x in range(ask_level)] + ['askqty_{0}'.format(x) for x in range(ask_level)]
		ts = _parse_ts(ts / 1000, convert_ts)
		res.name = ts
		return res
	except KeyError:
		print('{0} - parse_kline: wrong format'.format(dt.datetime.now()))
		return None

