def parse_hist_trade(huodict, start, end, convert_ts = None):
	#output: buy_volume, sell_volume, buy_price, sell_price
	try:
		raw_data = huodict['data']
		buy_volume  = 0
		sell_volume = 0
		buy_price  = 0
		sell_price = 0

		for trd in raw_data:
			ts = _parse_ts(trd['data'][0]['ts'] / 1000, convert_ts)
			if ts < start or ts > end:
				continue
			side = trd['data'][0]['direction']
			if side == 'sell':
				sell_volume += trd['data'][0]['amount']
				sell_price += trd['data'][0]['amount'] * trd['data'][0]['price']
			else:
				buy_volume += trd['data'][0]['amount']
				buy_price += trd['data'][0]['amount'] * trd['data'][0]['price']
		if buy_volume != 0:
			buy_price /= buy_volume
		if sell_volume != 0:
			sell_price /= sell_volume
		return {'buy_price': buy_price, 'buy_volume': buy_volume, 'sell_price': sell_price, 'sell_volume': sell_volume}

	except KeyError:
		print('{0} - parse_kline: wrong format'.format(dt.datetime.now()))
		return None

